import React from "react";
import './App.css';
import { Input } from "./Containers/Options";


class Main extends React.Component {
  constructor(props) {
    super(props);
    this.state = {data: null,
      facultyOptions: computingOptions,
      major: 'computingOptions',
      speciaisation: '',
      residence: ''}
  }

  changeFaculty(newFaculty) {
    this.setState({
      facultyOptions: newFaculty
    });
  }

  render() {
       return (
       <div className="App">
          <h1 className="App-title">Module Overview</h1>
          <Input onChange={this.changeFaculty} faculty={this.state.facultyOptions}/>




     </div>
   );
    }
}


export default Main;
